        <h2>三、进行小测试</h2>

        <p>
        <p><span style=""font-family: 宋体"">可以通过开始，应用程序中的</span> ""Oracle 11g"" -&gt; ""应用<a href=""http://www.2cto.com/kf"">程序开发</a>"" -&gt; ""Sql Developer 或Sql Plus"" 连接。</p>
        <p><span style=""font-family: 宋体"">注意第一次，使用</span>SQL Developer时，会提示指定 java.exe的路径，这里千万别指定自己的java_home了（我就是开始不知道，指定一个JDK6，结束说不兼容。）可以使用Oracel安装路径下面的jdk路径&nbsp;</p>
        <p>&nbsp;</p>
        <p>D:\Installation\oracle\product\11.2.0\dbhome_1\jdk\jre\bin（我的笔记本）</p>
        <p>&nbsp;<span style=""font-family: 宋体"">具体是：如图：。</span><br>&nbsp;");
            EndContext();
            BeginContext(5661, 77, false);
            __tagHelperExecutionContext = __tagHelperScopeManager.Begin("img", global::Microsoft.AspNetCore.Razor.TagHelpers.TagMode.StartTagOnly, "bd602a56f8b74a3ca5b514436f7b57b5", async() => {
            }
            );
            __Microsoft_AspNetCore_Mvc_Razor_TagHelpers_UrlResolutionTagHelper = CreateTagHelper<global::Microsoft.AspNetCore.Mvc.Razor.TagHelpers.UrlResolutionTagHelper>();
            __tagHelperExecutionContext.Add(__Microsoft_AspNetCore_Mvc_Razor_TagHelpers_UrlResolutionTagHelper);
            __tagHelperExecutionContext.AddHtmlAttribute(__tagHelperAttribute_21);
            __tagHelperExecutionContext.AddHtmlAttribute(__tagHelperAttribute_4);
            __tagHelperExecutionContext.AddHtmlAttribute(__tagHelperAttribute_6);
            await __tagHelperRunner.RunAsync(__tagHelperExecutionContext);
            if (!__tagHelperExecutionContext.Output.IsContentModified)
            {
                await __tagHelperExecutionContext.SetOutputContentAsync();
            }
            Write(__tagHelperExecutionContext.Output);
            __tagHelperExecutionContext = __tagHelperScopeManager.End();
            EndContext();
            BeginContext(5738, 3368, true);
            WriteLiteral(@"</p>
        <p><br><span style=""font-family: 宋体"">当然若不小心，选择错了。选择了</span>java_home中的高级版本，打开SQL Developer报错后不兼容，也有办法解决。可以在</p>
        <p><span style=""font-family: 宋体"">【</span>F:\app\chen\product\11.2.0\dbhome_1\sqldeveloper\sqldeveloper\bin】路径下找到【sqldeveloper.conf】文件后打开</p>
        <p><span style=""font-family: 宋体"">找到</span>SetJavaHome 所匹配的值，删除后面的配置内容。保证时会提示，只读文件不可覆盖保存。此时可以另存为到桌面上，然后再回到bin目录中删除掉此文件，再把桌面上的文件复制过去，再打开时，重新选择java.exe。此时选择对就好了。</p>
        <p>--------------------------------------------------------------------------------------------------------------------------------------</p>
        <p>安装64位版Oracle11gR2后发现启动SQL Developer时弹出配置java.exe的路径，找到Oracle自带java.exe后产生的路径“C:\app\用户名\product\11.2.0\dbhome_1\jdk”却弹出错误信息：</p>
        <p>－－－－－－－－－－－－－－－－－－－－－－－－－－<br>Unable to find a java Virtual Machine<br>to point to a location of a java virtual machine,please refer to the oracle9i Jdeveloper Install guide(jdev\install.html)<br>－－－－－－－－－－－－－－－－－－－－－－－－－－</p>
        <p>　　由于没有重新配置的机会，只好到安装目录“C:\app\用户名\");
            WriteLiteral(@"product\11.2.0\dbhome_1\sqldeveloper0\sqldeveloper\bin”中找到配置文件sqldeveloper.conf，修改其中“SetJavaHome”项为“SetJavaHome C:\Program Files\Java\jdk1.6.0_21”，这是另一个单独安装的JDK，结果还是一样。</p>
        <p>　　于是，又配置成MyEclipse8.5所带的JDK路径“SetJavaHome C:\Users\用户名\AppData\Local\Genuitec\Common\binary\com.sun.java.jdk.win32.x86_1.6.0.013”，一切正常，正纳闷时，到网络上搜了一下，找到“http://forums.oracle.com/forums/thread.jspa?messageID=4449178”后终于受到了启发，弄明白是怎么回事。</p>
        <p>　　原来Oracle在制造64位版的时候没注意Oracle11gR2所带的SQL Developer是1.5.5.59.69版，不支持64位版的JDK，恰好64位Oracle带的JDK和“C:\Program Files”中的JDK都是64位的。如果你单独安装的JDK中“C:\Program Files (x86)”中则说明是32位版的，是可以用的。为什么MyEclipse所带的JDK可用呢，因为MyEcipse8.5没有64位版（包括最新的8.6也一样），所以其中带的JDK当然是32位版的了。明白了吗？</p>
        <p>　　再来看看解决方案：</p>
        <p>　　既然你已经决定了要用64位版的Oracle11gR2：</p>
        <p>（1）单独安装一个32位版的JDK就可以直接配置了；</p>
        <p>（2）升级SQL Developer到2.1，把原来“C:\app\用户名\product\11.2.0\dbhome_1”下的的删除，下载（<a href=""http://download.oracle.com/otn/java/sqldeveloper/sqldeveloper64-2.1.1.64.45-no-jre.zip"">http://download.oracle.com/otn/ja");
            WriteLiteral(@"va/sqldeveloper/sqldeveloper64-2.1.1.64.45-no-jre.zip</a>）回来直接解压得到一个sqldeveloper文件夹放到同一位置即可。这时即可以配置“C:\Program Files”下的JDK，而Oracle自带的JDK，还是不能用的，因为这个2.1版的SQL Developer需要的JDK是1.6.0_04以上，而Oracle11gR2自带的JDK版本只有1.5.0_17。</p>
        <p>　　还没完哟，还有个小小的问题没有解决，“开始”菜单中的那个“SQL Developer”是指向“C:\app\用户名\product\11.2.0\dbhome_1\sqldeveloper\sqldeveloper\bin\sqldeveloper.bat”的，这个无法启动，也许你的机器可以启动，网络上有人说过这个问题，打开这个文件一看，内容是：</p>
        <p>java -Xmx640M -Xms128M -Xverify:none -Doracle.ide.util.AddinPolicyUtils.OVERRIDE_FLAG=true -Dsun.java2d.ddoffscreen=false -Dwindows.shell.font.languages= -XX:MaxPermSize=128M -Dide.AssertTracingDisabled=true -Doracle.ide.util.AddinPolicyUtils.OVERRIDE_FLAG=true -Djava.util.logging.config.file=logging.conf -Dsqldev.debug=false -Dide.conf=""./sqldeveloper.conf"" -Dide.startingcwd=""."" -classpath ../../ide/lib/ide-boot.jar oracle.ide.boot.Launcher</p>
        <p>　　解决办法是：把前面的“-Xmx640M”修改为“-Xmx512M”即可。但运行这个命令，单击那个允许运行程序的“是”后，没有任何反应，但直接在资源管理器中运行这个BAT文件会弹出一上类似DOS的窗口有很多信息显示后又弹出一个窗口，这个就是了。这样运行感觉不太好，所以继续");
            WriteLiteral(@"改造：</p>
        <p>　　在“开始”菜单中的“SQL Developer”上右击选属性，把目标中的“C:\app\用户名\product\11.2.0\dbhome_1\sqldeveloper\sqldeveloper\bin\sqldeveloper.bat”修改为“C:\app\用户名\product\11.2.0\dbhome_1\sqldeveloper\sqldeveloper\bin\sqldeveloperW.exe”即可。</p>
        <p>&nbsp;</p>
        </p>
